import React from 'react'
import projekte from "../../assets/img/Projekte-_1_"

const Projekte = () => {
  return (
    <div className={classes["projekte-container"]}>

        <h2 className={classes["projekte-titles"]}>Unser Dorf wird jeden Tag schöner ... </h2>
    <img className={classes["projekte-img"]} src={projekte} alt="grüne oase"></img>
    
  </div>
  )
}

export default Projekte
